3:27','2022-02-14 22:13:43'),(203,'Séptima pregunta',NULL,'<h6><strong>Para el día del idioma el profesor solicitó a los estudiantes algo para presentar a la comunidad, no cuentan con instrumentos y la verdad muchos estudiantes no cuentan con un vocabulario amplio para crear rimas complejas y tampoco hay instrumentos, de igual manera lo que se va a presentar debe ser entendible para la comunidad, ya que hay un gran índice de analfabetismo, por lo que si es algo escrito no lo podrán leer, lo mejor será algo que se pueda interpretar.</strong></h6><p></p><p><strong>En este caso lo mejor es presentar algo de qué género literario:</strong></p>',16,'seleccionMultiple',8,1,1,0,'2022-02-14 01:56:47','2022-02-14 22:16:29'),(204,'Octava pregunta',NULL,'<p>Hombres necios que acusáis<br>a la mujer sin razón<br>sin ver que sois la ocasión<br>de lo mismo que culpáis:</p><p>si con ansia sin igual<br>solicitáis su desdén<br>¿por qué queréis que obren bien<br>si las incitáis al mal?</p><p></p><p>Esta obra es del género</p>',16,'seleccionMultiple',8,1,1,0,'2022-02-14 02:09:22','2022-02-14 22:18:17'),(205,'Novena pregunta',NULL,'<h6><strong>OTELO:</strong> ¿Lo dices en serio?</h6><h6><br><strong>YAGO:</strong> Engañó a su padre al casarse con vos;<br>y, cuando parecía temblar y temer<br>vuestro semblante, es cuando más os quería.</h6><h6><br><strong>OTELO: </strong>Es verdad.</h6><h6><br><strong>YAGO: </strong>Pues, eso. Si tan joven ya sabía<br>sacar esa apariencia, dejando a su padre<br>tan ciego que creía que era magia...<br>He hecho muy mal. Os pido humildemente<br>perdón por apreciaros tanto.</h6><h6><br><strong>OTELO: </strong>Siempre te estaré agradecido.<br></h6><h6><strong>YAGO: </strong>Veo que esto os ha desconcertado.</h6><h6><br><strong>OTELO: </strong>Nada de eso, nada de eso.</h6><p></p><p></p><p>El fragmento anterior es del género</p>',16,'seleccionMultiple',8,1,1,0,'2022-02-14 02:15:10','2022-02-14 22:19:53'),(206,'Décima pregunta',NULL,'<h6>—¿Dónde están vuestros padres?</h6><p>Los niños comenzaron a sonreír. Uno de los pequeños había cogido uno de los fusiles</p><p>de los patrulleros.</p><p>—Deja eso, es peligroso andar con armas... —dijo uno de los agentes al niño, que parecía divertido</p><p>apuntándole.</p><p>—Basta de bromas —dijo el otro agente, algo nervioso. Se miraron entre sí.</p><p>Los niños reían.</p><p>Los agentes comprendieron. Pudieron intuir vagamente lo que en realidad había sucedido en aquel malecón. Pero fue tarde.</p><p>El niño le disparó al corazón. Cuando los patrulleros quedaron sin vida, los niños gritaron ensordecedoramente</p><p></p><p>El anterior fragmento es de</p><h2>El juego de los niños</h2><p>de <strong>Juan José Plans</strong></p><p></p><p>Es del género: <br></p>',16,'seleccionMultiple',8,1,1,0,'2022-02-14 02:22:24','2022-02-14 22:22:40'),(207,'Undécima pregunta',NULL,'<h6>Nada tienen de especial<br>Dos mujeres que se dan la mano<br>El matiz viene después<br>Cuando lo hacen por debajo del mantel</h6><p>Luego a solas sin nada que perder<br>Tras las manos va el resto de la piel<br>Un amor por ocultar<br>Aunque en cueros no hay donde esconderlo<br>Lo disfrazan de amistad<br>Cuando sale a pasear por la ciudad</p><p></p><p>El fragmento anterior es del género</p>',16,'seleccionMultiple',8,1,1,0,'2022-02-14 02:49:51','2022-02-14 22:24:11'),(208,'Duodécima pregunta',NULL,'<p><strong>Abuela alma: </strong>Abre los ojos.</p><p><strong>Mirabel niña: </strong>¿De aquí viene nuestra magia?</p><p><strong>Abuela alma:</strong> Ajá. Esta vela contiene el milagro</p><p>que se le concedió a nuestra familia.</p>',16,'seleccionMultiple',8,1,1,0,'2022-02-14 02:57:15','2022-02-14 22:25:26'),(209,'Decimotercera pregunta',NULL,'<p>–Yo soy el Recitador de la Ley –replicó la figura gris–. Aquí vienen todos los nuevos para aprender la Ley. Me siento en la oscuridad y recito la Ley.</p><p>–Así es –añadió una de las bestias desde la puerta. –Terrible es el castigo para quienes quebrantan la Ley. No hay escapatoria.</p><p>–No hay escapatoria –repitió la multitud de Salvajes, lanzándose miradas furtivas los unos a los otros.</p><p>–No hay escapatoria –repitió el Hombre Mono–. No la hay. ¡Mira! Una vez hice algo malo, algo sin importancia. Dejé de hablar y empecé a chapurrear. Nadie me entendía. Y me quemaron, me marcaron la mano con un hierro candente. ¡Él es grande; Él es bueno!</p><p>–No hay escapatoria –proclamó la criatura del rincón.</p><p>–No hay escapatoria –repitieron las bestias, mirándose de reojo.</p><p>–Porque todos deseamos el mal –continuó el recitador de la Ley–. No sabemos lo que tú deseas. Pero lo sabremos.</p><p></p><p>El anterior fragmento pertenece a \"La isla del doctor Moreau\"</p>',16,'seleccionMultiple',8,1,1,0,'2022-02-14 03:07:45','2022-02-14 22:26:50'),(210,'Decimocuarta pregunta',NULL,'<p>Los suspiros son aire<br>siempre se van hacia el mar.<br>Las lágrimas son de agua<br>y se van a resecar.<br><br>Mujer, cuando el amor se olvida<br>¿sabes tú a dónde va?<br>no me quejo ni tu olvido<br>tu cariño mucho más</p><p></p><p></p>',16,'seleccionMultiple',8,1,1,0,'2022-02-14 03:26:22','2022-02-14 22:28:52'),(211,'Primera pregunta',NULL,'<p><strong>Es el medio por el cual se transmite el mensaje</strong></p>',17,'seleccionMultiple',5,1,0,0,'2022-02-15 17:33:04','2022-02-15 17:42:37'),(212,'Segunda pregunta',NULL,'<h6><strong>Es quien codifica y envía el mensaje </strong></h6>',17,'seleccionMultiple',5,1,0,0,'2022-02-15 17:33:04','2022-02-15 17:33:04'),(213,'Tercera pregunta',NULL,'<h6><strong>Es la información que se desea transmitir</strong></h6>',17,'seleccionMultiple',5,1,0,0,'2022-02-15 17:33:04','2022-02-15 17:33:04'),(214,'Cuarta pregunta',NULL,'<h6><strong>Daniela está cruzando la calle, hay un semáforo vehicular, el semáforo marca la luz roja, ella logra verla con claridad, sin embargo no conoce su significado así que cruza sin preocuparse.</strong></h6><p>*Cruza y se muere :v</p><p></p><p><strong>El fallo en la comunicación estuvo en:</strong></p>',17,'seleccionMultiple',8,1,0,0,'2022-02-15 17:33:04','2022-02-15 17:33:04'),(215,'Quinta pregunta',NULL,'<h6><strong>Carolina está escribiendo una carta, con un lapicero de 200 pesos que le vendieron por ahí, la carta era totalmente legible y estaba bien escrita, pero cuando su enamorado recibió la carta la tinta estaba toda corrida, no pudo entender el mensaje.</strong></h6>',17,'seleccionMultiple',8,1,0,0,'2022-02-15 17:33:04','2022-02-15 17:33:04'),(216,'Sexta pregunta',NULL,'<h6><strong>Didier recibió una llamada importante de una empresa que desea contratarlo, pero la antena de Claro está fallando, por lo que no logra entender lo que le quieren decir. </strong></h6>',17,'seleccionMultiple',8,1,0,0,'2022-02-15 17:33:04','2022-02-15 17:33:04'),(217,'Séptima pregunta',NULL,'<h6><strong>Charlie recibió una llamada de su esposa, ella se enteró que pasó la noche en casa de una compañera de trabajo, para evadir la llamada Charlie dice que está pasando por un túnel y finge problemas de señal hablando de manera enrecortada. </strong></h6><p></p>',17,'seleccionMultiple',8,1,0,0,'2022-02-15 17:33:04','2022-02-15 17:33:04'),(218,'Octava pregunta',NULL,'<p><strong>Margarita quiere conseguir un novio estadounidense, descargó una app de intercambio de idiomas para hablar con extranjeros que quieren practicar español, pero resulta que ella no puede ni siquiera responder un mensaje de una conversación simple.</strong></p>',17,'seleccionMultiple',8,1,0,0,'2022-02-15 17:33:04','2022-02-15 17:33:04'),(219,'Novena pregunta',NULL,'<h6><strong>Dayan escribió un documento para solicitar la reconexión de la luz, el documento se guardó correctamente, pero al momento de anexar el documento se equivocó y envió una carta de amor que había escrito a su pareja horas antes. Ahora el señor de Celsia cree que Dayan lo ama.</strong></h6>',17,'seleccionMultiple',8,1,0,0,'2022-02-15 17:33:04','2022-02-15 17:33:04'),(220,'Décima pregunta',NULL,'<h6><strong>Jirney le gusta el kpop, escribió una carga para su grupo de kpop favorito usando google translator,  lastimosamente la traducción no fue correcta y los integrantes se tomaron su mensaje como una ofensa. </strong></h6>',17,'seleccionMultiple',8,1,0,0,'2022-02-15 17:33:04','2022-02-15 17:33:04'),(221,'Primera pregunta',NULL,'<p>Parte del ensayo en la que se hace el cierre y se comprueba la tesis.</p>',18,'seleccionMultiple',5,1,1,0,'2022-02-16 03:38:48','2022-02-16 19:28:25'),(222,'Segunda pregunta',NULL,'<p>Parte del ensayo en la que se exponen las razones o argumentos que intentan apoyar la tesis.</p>',18,'seleccionMultiple',5,1,1,0,'2022-02-16 03:39:41','2022-02-16 19:29:40'),(223,'Tercera pregunta',NULL,'<p>Parte del ensayo en la que se presenta el tema y se plantea la tesis o idea a demostrar.</p>',18,'seleccionMultiple',5,1,1,0,'2022-02-16 03:40:54','2022-02-16 19:30:57'),(224,'cuarta pregunta',NULL,'<p>Para finalizar, y luego de haber analizado los argumentos presentados, se puede decir que, efectivamente el consumo de colorantes artificiales afectan la flora intestinal, produciendo alteraciones nocivas para el organismo, por lo que debe prohibirse su uso.</p><p></p><p><strong>Esta parte es:</strong></p>',18,'seleccionMultiple',8,1,1,0,'2022-02-16 03:45:11','2022-02-16 19:32:48'),(225,'quinta pregunta',NULL,'<p></p><p>La primera razón por la que desaconsejamos el uso de conservantes artificiales es debido a que se ha descubierto que un consumo excesivo de estas sustancias es un factor de riesgo cuando se habla de adquirir cáncer gástrico.</p><p>Así mismo otro argumento en contra del uso de conservantes es porque se ha encontrado una relación en su uso y los altos índices de anemia.</p><p></p><p>Este fragmento corresponde a:</p>',18,'seleccionMultiple',8,1,1,0,'2022-02-16 03:48:47','2022-02-16 19:35:42'),(226,'sexta pregunta',NULL,'<p>En el presente texto se pretende hablar de la importancia de la lúdica en la educación. A través de los diferentes autores que se analizarán se pretende demostrar que el juego y la competencia constituyen un factor fundamental en el desarrollo y la motivación de los estudiantes.</p><p></p><p>Este fragmento corresponde a:</p>',18,'seleccionMultiple',8,1,1,0,'2022-02-16 04:02:44','2022-02-16 19:37:53'),(227,'séptima pregunta',NULL,'<p>Después de analizar los diferentes casos, se tiene entonces evidencia que efectivamente el tratamiento realizado con el medicamento Antidiarrex 500 favoreció la calidad de las deposiciones de los pacientes, disminuyendo los índices de diarrea en un 90%, el 10% restante no se benefició de sus efectos debido al consumo de frijoles con kumis, lo que hizo inefectivo el medicamento. Por lo que podemos decir que se considera un tratamiento efectivo.</p>',18,'seleccionMultiple',8,1,1,0,'2022-02-16 04:10:08','2022-02-16 19:39:46'),(228,'octava pregunta',NULL,'<p>En el desarrollo del presente trabajo hablaremos del <strong>consumo del alcohol</strong>, pero no de sus efectos en la salud, sino que se intentará demostrar que <u>es la principal causa de accidentes automovilísticos; </u>para lo cual se analizarán <s>los datos de los accidentes de los últimos 10 años en Colombia.</s></p><p>Identifique cuál es la tesis y cuál es el tema.</p>',18,'seleccionMultiple',8,1,1,0,'2022-02-16 04:14:21','2022-02-16 19:41:48'),(229,'novena pregunta',NULL,'<p>Con motivo de la conmemoración <strong>del día de la mujer</strong>, el presente ensayo hablará del <u>sistema de apoyo legal a mujeres</u>, nuestro objetivo es demostrar que <s>el sistema de apoyo es ineficiente pues fué creado desde una perspectiva machista y sin consulta femenina.</s></p>',18,'seleccionMultiple',8,1,1,0,'2022-02-16 04:19:12','2022-02-16 19:43:40'),(230,'décima pregunta',NULL,'<p>Se ha hablado mucho de las diferentes dietas para bajar peso, <s>cada día en tok tok aparecen más influence<u>rs</u></s> que sin ser nutriólogas hacen diferentes recomendaciones en la alimentación, hoy hablaremos de <strong>la dieta Keto</strong> y por qué está <u>es un riesgo para la salud</u></p>',18,'seleccionMultiple',8,1,1,0,'2022-02-16 04:26:41','2022-02-16 19:45:48'),(231,'undécima pregunta',NULL,'<p>Uno de los siguientes argumentos no es adecuado para apoyar el consumo de carnes</p>',18,'seleccionMultiple',6,1,1,0,'2022-02-16 04:28:04','2022-02-16 20:30:32'),(232,'duodécima pregunta',NULL,'<p>Uno de los siguientes argumentos sirve para apoyar la venta de mascotas</p>',18,'seleccionMultiple',6,1,1,0,'2022-02-16 04:28:45','2022-02-16 20:32:29'),(233,'decimotercera pregunta',NULL,'<p>Uno de los siguientes argumentos no sirve para apoyar el uso de cirugías estéticas</p>',18,'seleccionMultiple',6,1,1,0,'2022-02-16 04:30:43','2022-02-16 20:34:07'),(234,'decimocuarta pregunta',NULL,'<p>Uno de los siguientes argumentos sirve para apoyar el uso de criptomonedas.</p>',18,'seleccionMultiple',6,1,1,0,'2022-02-16 04:31:26','2022-02-16 20:36:11'),(235,'Decimoquinta pregunta',NULL,'<p>Debe presentar un argumento en contra del veganismo, uno que podría servir sería:</p>',18,'seleccionMultiple',8,1,1,0,'2022-02-16 04:59:10','2022-02-16 20:38:21'),(236,'Decimo sexta pregunta',NULL,'<h6><strong>Ordena el ensayo</strong></h6><p><strong>1</strong></p><p><strong>El primer argumento que planteamos para defender nuestro punto es el hecho que la mayoría de fumadores de tabaco se han enfrentado a problemas pulmonares más de una vez en su vida.</strong></p><p><strong>Sumado a eso, se ha descubierto que el humo de tabaco contiene múltiples agentes cancerígenos, lo que hace que los consumidores tengan más probabilidades de desarrollar esta enfermedad.</strong></p><p><strong>Nuestro último argumento han sido los índices de aborto relacionados con el consumo del tabaco, el 80% de las mujeres que fueron fumadoras constantes durante su embarazo, tuvieron un riesgo de aborto o su hijo nació con alguna deformidad o discapacidad.</strong></p><p></p><p><strong>2</strong></p><p><strong>Es por esta razón que cerramos el texto recomendando a la gente que no fume, ya que como se observa, el fumar produce grandes riesgos para la salud, por lo que las regulaciones de su consumo deberían ser mayores y prohibirse la venta a menores de edad y mujeres embarazadas,</strong></p><p></p><p><strong>3</strong></p><p><strong>En el presente texto hablaremos de una popular costumbre que ha estado en nuestro país durante años, el consumo de tabaco. Si bien el fumar es algo muy común hoy en día, queremos demostrar gracia a las investigaciones que se hicieron este año (1982), que fumar conlleva unos riesgos muy serios, por lo que lo desaconsejamos.</strong></p><p></p>',18,'seleccionMultiple',10,1,1,0,'2022-02-16 05:26:50','2022-02-16 20:40:55'),(237,'Primera pregunta',NULL,'<h6><strong>Género literario enfocado en contar historias, no necesita ser interpretado en público.</strong></h6>',19,'seleccionMultiple',5,1,1,0,'2022-02-16 07:46:52','2022-02-16 18:07:44'),(238,'Segunda pregunta',NULL,'<h6><strong>Género literario que requiere de actores para ser representado.</strong></h6>',19,'seleccionMultiple',5,1,1,0,'2022-02-16 07:47:13','2022-02-16 18:08:47'),(239,'Tercera pregunta',NULL,'<h6><strong>Género literario enfocado en los sentimientos, que muchas veces usa le métrica y la rima.</strong></h6>',19,'seleccionMultiple',5,1,1,0,'2022-02-16 07:47:13','2022-02-16 18:13:45'),(240,'Cuarta pregunta',NULL,'<h6><strong>La historia clásica de caperucita ha sido contada durante cientos de años: cuenta la historia de una niña que tiene que atravesar un bosque pero es engañada por un lobo para abandonar el camino.</strong></h6><p><strong>Es del género:</strong></p>',19,'seleccionMultiple',8,1,1,0,'2022-02-16 07:47:13','2022-02-16 18:15:11'),(241,'Quinta pregunta',NULL,'<p>La artista presentó su obra el día de ayer, una obra llena de ritmo y sabor, que hizo bailar a todo el público, con una letra alegre que nos recuerda los días de verano y la alegría de las vacaciones.</p><p></p><p>Lo más probable es que la descripción sea de</p>',19,'seleccionMultiple',8,1,1,0,'2022-02-16 07:47:13','2022-02-16 18:14:33'),(242,'Sexta pregunta',NULL,'<p>La cantante Lady Gaga siempre ha sido conocida por se un ícono de la música pop, sin embargo, este año la vimos en su faceta como actriz en la película House of Gucci</p><p></p><p>Esta información nos dice que:</p>',19,'seleccionMultiple',8,1,1,0,'2022-02-16 07:47:13','2022-02-16 18:16:16'),(243,'Séptima pregunta',NULL,'<h6><strong>Para el día del idioma el profesor solicitó a los estudiantes algo para presentar a la comunidad, no cuentan con instrumentos y la verdad muchos estudiantes no cuentan con un vocabulario amplio para crear rimas complejas, de igual manera lo que se va a presentar debe ser entendible para la comunidad, ya que hay un gran índice de analfabetismo, por lo que si es algo escrito no lo podrán leer, lo mejor será algo que se pueda interpretar.</strong></h6><p></p><p><strong>En este caso lo mejor es presentar algo de qué género literario:</strong></p>',19,'seleccionMultiple',8,1,1,0,'2022-02-16 07:47:13','2022-02-16 18:18:41'),(244,'Octava pregunta',NULL,'<p>Hombres necios que acusáis<br>a la mujer sin razón<br>sin ver que sois la ocasión<br>de lo mismo que culpáis:</p><p>si con ansia sin igual<br>solicitáis su desdén<br>¿por qué queréis que obren bien<br>si las incitáis al mal?</p><p></p><p>Esta obra es del género</p>',19,'seleccionMultiple',8,1,1,0,'2022-02-16 07:47:13','2022-02-16 18:19:59'),(245,'Novena pregunta',NULL,'<h6><strong>OTELO:</strong> ¿Lo dices en serio?</h6><h6><br><strong>YAGO:</strong> Engañó a su padre al casarse con vos;<br>y, cuando parecía temblar y temer<br>vuestro semblante, es cuando más os quería.</h6><h6><br><strong>OTELO: </strong>Es verdad.</h6><h6><br><strong>YAGO: </strong>Pues, eso. Si tan joven ya sabía<br>sacar esa apariencia, dejando a su padre<br>tan ciego que creía que era magia...<br>He hecho muy mal. Os pido humildemente<br>perdón por apreciaros tanto.</h6><h6><br><strong>OTELO: </strong>Siempre te estaré agradecido.<br></h6><h6><strong>YAGO: </strong>Veo que esto os ha desconcertado.</h6><h6><br><strong>OTELO: </strong>Nada de eso, nada de eso.</h6><p></p><p></p><p>El fragmento anterior es del género</p>',19,'seleccionMultiple',8,1,1,0,'2022-02-16 07:47:13','2022-02-16 18:21:48'),(246,'Décima pregunta',NULL,'<h6>—¿Dónde están vuestros padres?</h6><p>Los niños comenzaron a sonreír. Uno de los pequeños había cogido uno de los fusiles</p><p>de los patrulleros.</p><p>—Deja eso, es peligroso andar con armas... —dijo uno de los agentes al niño, que parecía divertido</p><p>apuntándole.</p><p>—Basta de bromas —dijo el otro agente, algo nervioso. Se miraron entre sí.</p><p>Los niños reían.</p><p>Los agentes comprendieron. Pudieron intuir vagamente lo que en realidad había sucedido en aquel malecón. Pero fue tarde.</p><p>El niño le disparó al corazón. Cuando los patrulleros quedaron sin vida, los niños gritaron ensordecedoramente</p><p></p><p>El anterior fragmento es de</p><h2>El juego de los niños</h2><p>de <strong>Juan José Plans</strong></p><p></p><p>Es del género: <br></p>',19,'seleccionMultiple',8,1,1,0,'2022-02-16 07:47:13','2022-02-16 18:23:23'),(247,'Undécima pregunta',NULL,'<h6>Nada tienen de especial<br>Dos mujeres que se dan la mano<br>El matiz viene después<br>Cuando lo hacen por debajo del mantel</h6><p>Luego a solas sin nada que perder<br>Tras las manos va el resto de la piel<br>Un amor por ocultar<br>Aunque en cueros no hay donde esconderlo<br>Lo disfrazan de amistad<br>Cuando sale a pasear por la ciudad</p><p></p><p>El fragmento anterior es del género</p>',19,'seleccionMultiple',8,1,1,0,'2022-02-16 07:47:13','2022-02-16 18:25:08'),(248,'Duodécima pregunta',NULL,'<p><strong>Abuela alma: </strong>Abre los ojos.</p><p><strong>Mirabel niña: </strong>¿De aquí viene nuestra magia?</p><p><strong>Abuela alma:</strong> Ajá. Esta vela contiene el milagro</p><p>que se le concedió a nuestra familia.</p>',19,'seleccionMultiple',8,1,1,0,'2022-02-16 07:47:13','2022-02-16 18:26:38'),(249,'Decimotercera pregunta',NULL,'<p>–Yo soy el Recitador de la Ley –replicó la figura gris–. Aquí vienen todos los nuevos para aprender la Ley. Me siento en la oscuridad y recito la Ley.</p><p>–Así es –añadió una de las bestias desde la puerta. –Terrible es el castigo para quienes quebrantan la Ley. No hay escapatoria.</p><p>–No hay escapatoria –repitió la multitud de Salvajes, lanzándose miradas furtivas los unos a los otros.</p><p>–No hay escapatoria –repitió el Hombre Mono–. No la hay. ¡Mira! Una vez hice algo malo, algo sin importancia. Dejé de hablar y empecé a chapurrear. Nadie me entendía. Y me quemaron, me marcaron la mano con un hierro candente. ¡Él es grande; Él es bueno!</p><p>–No hay escapatoria –proclamó la criatura del rincón.</p><p>–No hay escapatoria –repitieron las bestias, mirándose de reojo.</p><p>–Porque todos deseamos el mal –continuó el recitador de la Ley–. No sabemos lo que tú deseas. Pero lo sabremos.</p><p></p><p>El anterior fragmento pertenece a \"La isla del doctor Moreau\"</p>',19,'seleccionMultiple',8,1,1,0,'2022-02-16 07:47:14','2022-02-16 18:28:04'),(250,'Decimocuarta pregunta',NULL,'<p>Los suspiros son aire<br>siempre se van hacia el mar.<br>Las lágrimas son de agua<br>y se van a resecar.<br><br>Mujer, cuando el amor se olvida<br>¿sabes tú a dónde va?<br>no me quejo ni tu olvido<br>tu cariño mucho más</p><p></p><p></p>',19,'seleccionMultiple',8,1,1,0,'2022-02-16 07:47:14','2022-02-16 18:29:56'),(251,'Primera pregunta',NULL,'<h6><strong>La parte del cuento donde se presentan los problemas o dificultades para los protagonistas se llama :</strong></h6>',20,'seleccionMultiple',5,1,1,0,'2022-02-17 18:31:10','2022-02-18 20:48:22'),(252,'Segunda pregunta',NULL,'<h6><strong>La parte del cuento donde se presentan los personajes, el tiempo y el lugar, se llama:</strong></h6>',20,'seleccionMultiple',5,1,1,0,'2022-02-17 18:32:50','2022-02-18 20:48:58'),(253,'Tercera pregunta',NULL,'<h6><strong>La parte del cuento donde se concluyen la historia y se da resolución a los problemas.</strong></h6>',20,'seleccionMultiple',5,1,1,0,'2022-02-17 18:35:06','2022-02-18 20:49:24'),(254,'Cuarta pregunta',NULL,'<h6><strong>Analice el siguiente fragmento e identifique a qué parte del cuento corresponde:</strong></h6><p>Luego de escucharla decidí aceptar el caso, pero ¿por dónde empezar? Quise visitar la escena del crimen, me dio las indicaciones y fuimos. Tomé mi cámara, registré todo lo que pude ver, pero sin duda el mayor problema que tenía era el hecho que ningún dato concordaba, las huellas de la entrada eran de suela de bota, pero las huellas de la cocina eran de zapato deportivo, no pudo ser mi cliente, porque me confirmó que no usa zapato deportivo, registré su armario, era cierto, solo sandalias y zapatos de tacón; la entrada no había sido forzada, pero el ladró escapó rompiendo una ventana, nada tenía sentido.</p><p></p>',20,'seleccionMultiple',9,1,1,0,'2022-02-17 20:11:39','2022-02-18 20:51:47'),(255,'Quinta pregunta',NULL,'<p>Había sido todo un juego para ella, un engaño para tenerme ocupado, para tenerme cerca, no había caso a investigar, ni siquiera existía el colgante que dijo querer recuperar. &nbsp;Terminó por confesarme todo, que me había visto antes, que se había interesado en mí y en cuanto supo de mi trabajo como detective privado me buscó y se inventó la historia del colgante para conocerme. Así finalizó mi caso, lo que sucedió después es otra historia.</p>',20,'seleccionMultiple',9,1,1,0,'2022-02-17 20:12:13','2022-02-18 20:53:19'),(256,'Sexta pregunta',NULL,'<p>Todo empezó en Abril, trabajaba yo en mi oficina de New York cuando ella llegó, con su pintalabios rojo y su vestido negro, se le veía enojada.</p><p>-¿es usted el detective John Carter?- &nbsp;dijo</p><p>-Sí, soy yo- le respondí</p><p>Le ofrecí asiento y una taza de café, es el protocolo que tengo con mis clientes, los hace entrar en confianza y es más fácil así que me expliquen su caso.</p>',20,'seleccionMultiple',9,1,1,0,'2022-02-17 21:37:08','2022-02-18 20:54:57'),(257,'Séptima pregunta',NULL,'<p>Finalmente nos reunimos en el parque aquella tarde, yo me sentía nervioso, no sabíamos que estaba pasando. Luego el alcalde pidió la atención de todos, y nos dijo:</p><p>-Estimada comunidad, se les pidió reunirse aquí por una razón que tal vez ya muchos conozcan, el nivel del río a crecido demasiado, ya las casas de la familia Ramirez y la de la familia Gomez se las llevó la crecida, todo el pueblo está en riesgo, lo mejor es evacuar, por lo menos mientras la temporada de lluvias termina y vemos cómo reconstruir y solucionar todo.</p><p>Y fue así como empezó todo, nos mudamos con mi familia a la ciudad, creímos que sería temporal, pero la crecida fue terrible, cuando quisimos regresar el río se lo había llevado todo: nuestra casa, nuestro ganado, los cultivos. Mis padres decidieron seguir en la ciudad, si debían empezar de ceros otra vez era preferible hacerlo en la ciudad que en un pueblo destruido.</p><p></p><p><strong>¿Qué tipo de narrador se usa en la historia?</strong></p>',20,'seleccionMultiple',8,1,1,0,'2022-02-17 22:20:11','2022-02-18 20:56:58'),(258,'Octava pregunta',NULL,'<p>Finalmente el pueblo se reunió en el parque aquella tarde, la mayoría con nervios, nadie sabía lo que estaba pasando. Luego el alcalde pidió la atención de todos, y dijo:</p><p>-Estimada comunidad, se les pidió reunirse aquí por una razón que tal vez ya muchos conozcan, el nivel del río a crecido demasiado, ya las casas de la familia Ramirez y la de la familia Gomez se las llevó la crecida, todo el pueblo está en riesgo, lo mejor es evacuar, por lo menos mientras la temporada de lluvias termina y vemos cómo reconstruir y solucionar todo.</p><p>Y así fue como empezó la migración de todas esas familias, muchas con una tristeza indescriptible en su corazón, porque sabían que no regresarían; otras, negándose a creer que este era el fin, se aferraban a la idea de regresar, creyeron que no serían más que lluvias normales y que al acabar las tormentas podrían regresar. Al final la mayoría no volvió, y los pocos que lo hicieron se marcharon meses después, no tenía sentido luchar en reconstruir un pueblo fantasma. Aún así, sus habitantes al dormir podían ver su querido pueblo en sueños.</p>',20,'seleccionMultiple',8,1,1,0,'2022-02-17 22:26:41','2022-02-18 20:59:16'),(259,'Novena pregunta',NULL,'<p>Finalmente el pueblo se reunió en el parque aquella tarde, el alcalde pidió la atención de todos, y dijo:</p><p>-Estimada comunidad, se les pidió reunirse aquí por una razón que tal vez ya muchos conozcan, el nivel del río a crecido demasiado, ya las casas de la familia Ramirez y la de la familia Gomez se las llevó la crecida, todo el pueblo está en riesgo, lo mejor es evacuar, por lo menos mientras la temporada de lluvias termina y vemos cómo reconstruir y solucionar todo.</p><p>Y así fue como empezó la migración de todas esas familias, de las cuales pocas regresaron, y aquellas que lo hicieron se fueron al cabo de poco tiempo, nadie podría describir lo que pasaba por sus corazones y sólo ellos entenderían su propio sufrimiento.</p>',20,'seleccionMultiple',8,1,1,0,'2022-02-17 22:30:18','2022-02-18 21:01:07'),(260,'Décima pregunta',NULL,'<h6><strong>Clasifique las siguientes narraciones</strong></h6><p></p><p><strong>Texto 1: </strong>La historia de Hanzel y Grettel es una narración de la tradición popular europea, es una obra de extensión corta que cuenta cómo dos niños abandonados se encuentran con una bruja que intenta comerlo, logran engañarla y escapar. Esta historia fue recopilada por los Hermanos Grimm para su famosa antología.</p><p></p><p><strong>Texto 2:</strong> La historia de Pandora trata de dar explicación al origen de los males del mundo, este relato de dioses y semidioses del mundo griego ha llegado hasta nuestros días gracias a antiguos registros.</p><p></p><p><strong>Texto 3: </strong>La historia de San Agustin relata la vida de un soldado romano, que vivió entre el año 275 y el año 303 DC. Si bien se tiene registros de que es un personaje real, su vida a veces se mezcla con la ficción, como el episodio en el que lucha con un dragón.</p>',20,'seleccionMultiple',9,1,1,0,'2022-02-17 22:42:58','2022-02-18 21:04:15'),(261,'Primera pregunta',NULL,'<p>Parte del ensayo en la que se hace el cierre y se comprueba la tesis.</p>',21,'seleccionMultiple',5,1,1,0,'2022-02-18 07:28:20','2022-02-18 22:22:22'),(262,'Segunda pregunta',NULL,'<p>Parte del ensayo en la que se exponen las razones o argumentos que intentan apoyar la tesis.</p>',21,'seleccionMultiple',5,1,1,0,'2022-02-18 07:28:21','2022-02-18 22:24:02'),(263,'Tercera pregunta',NULL,'<p>Parte del ensayo en la que se presenta el tema y se plantea la tesis o idea a demostrar.</p>',21,'seleccionMultiple',5,1,1,1,'2022-02-18 07:28:21','2022-02-18 22:24:24'),(264,'cuarta pregunta',NULL,'<p>Para finalizar, y luego de haber analizado los argumentos presentados, se puede decir que, efectivamente el consumo de colorantes artificiales afectan la flora intestinal, produciendo alteraciones nocivas para el organismo, por lo que debe prohibirse su uso.</p><p></p><p><strong>Esta parte es:</strong></p>',21,'seleccionMultiple',8,1,1,0,'2022-02-18 07:28:21','2022-02-18 22:27:18'),(265,'quinta pregunta',NULL,'<p></p><p>La primera razón por la que desaconsejamos el uso de conservantes artificiales es debido a que se ha descubierto que un consumo excesivo de estas sustancias es un factor de riesgo cuando se habla de adquirir cáncer gástrico.</p><p>Así mismo otro argumento en contra del uso de conservantes es porque se ha encontrado una relación en su uso y los altos índices de anemia.</p><p></p><p>Este fragmento corresponde a:</p>',21,'seleccionMultiple',8,1,1,0,'2022-02-18 07:28:21','2022-02-18 22:29:01'),(266,'sexta pregunta',NULL,'<p>En el presente texto se pretende hablar de la importancia de la lúdica en la educación. A través de los diferentes autores que se analizarán se pretende demostrar que el juego y la competencia constituyen un factor fundamental en el desarrollo y la motivación de los estudiantes.</p><p></p><p>Este fragmento corresponde a:</p>',21,'seleccionMultiple',8,1,1,0,'2022-02-18 07:28:21','2022-02-18 22:31:21'),(267,'séptima pregunta',NULL,'<p>Después de analizar los diferentes casos, se tiene entonces evidencia que efectivamente el tratamiento realizado con el medicamento Antidiarrex 500 favoreció la calidad de las deposiciones de los pacientes, disminuyendo los índices de diarrea en un 90%, el 10% restante no se benefició de sus efectos debido al consumo de frijoles con kumis, lo que hizo inefectivo el medicamento. Por lo que podemos decir que se considera un tratamiento efectivo.</p>',21,'seleccionMultiple',8,1,1,0,'2022-02-18 07:28:21','2022-02-18 22:33:17'),(268,'octava pregunta',NULL,'<p>En el desarrollo del presente trabajo hablaremos del <strong>consumo del alcohol</strong>, pero no de sus efectos en la salud, sino que se intentará demostrar que <u>es la principal causa de accidentes automovilísticos; </u>para lo cual se analizarán <s>los datos de los accidentes de los últimos 10 años en Colombia.</s></p><p>Identifique cuál es la tesis y cuál es el tema.</p>',21,'seleccionMultiple',8,1,1,0,'2022-02-18 07:28:21','2022-02-18 22:38:57'),(269,'novena pregunta',NULL,'<p>Con motivo de la conmemoración <strong>del día de la mujer</strong>, el presente ensayo hablará del <u>sistema de apoyo legal a mujeres</u>, nuestro objetivo es demostrar que <s>el sistema de apoyo es ineficiente pues fué creado desde una perspectiva machista y sin consulta femenina.</s></p>',21,'seleccionMultiple',8,1,1,0,'2022-02-18 07:28:21','2022-02-18 22:41:42'),(270,'décima pregunta',NULL,'<p>Se ha hablado mucho de las diferentes dietas para bajar peso, <s>cada día en tik tok aparecen más influence<u>rs</u></s> que sin ser nutriólogas hacen diferentes recomendaciones en la alimentación, hoy hablaremos de <strong>la dieta Keto</strong> y por qué está <u>es un riesgo para la salud</u></p>',21,'seleccionMultiple',8,1,1,0,'2022-02-18 07:28:21','2022-02-18 22:44:56'),(271,'undécima pregunta',NULL,'<p>Uno de los siguientes argumentos no es adecuado para apoyar el consumo de carnes</p>',21,'seleccionMultiple',6,1,1,0,'2022-02-18 07:28:21','2022-02-18 22:47:54'),(272,'duodécima pregunta',NULL,'<p>Uno de los siguientes argumentos sirve para apoyar la venta de mascotas</p>',21,'seleccionMultiple',6,1,1,0,'2022-02-18 07:28:22','2022-02-18 22:48:51'),(273,'decimotercera pregunta',NULL,'<p>Uno de los siguientes argumentos no sirve para apoyar el uso de cirugías estéticas</p>',21,'seleccionMultiple',6,1,1,1,'2022-02-18 07:28:22','2022-02-18 22:50:57'),(274,'decimocuarta pregunta',NULL,'<p>Uno de los siguientes argumentos sirve para apoyar el uso de criptomonedas.</p>',21,'seleccionMultiple',6,1,1,0,'2022-02-18 07:28:22','2022-02-18 22:52:25'),(275,'Decimoquinta pregunta',NULL,'<p>Debe presentar un argumento en contra del veganismo, uno que podría servir sería:</p>',21,'seleccionMultiple',8,1,1,0,'2022-02-18 07:28:22','2022-02-18 22:53:56'),(276,'Decimo sexta pregunta',NULL,'<h6><strong>Ordena el ensayo</strong></h6><p><strong>1</strong></p><p><strong>El primer argumento que planteamos para defender nuestro punto es el hecho que la mayoría de fumadores de tabaco se han enfrentado a problemas pulmonares más de una vez en su vida.</strong></p><p><strong>Sumado a eso, se ha descubierto que el humo de tabaco contiene múltiples agentes cancerígenos, lo que hace que los consumidores tengan más probabilidades de desarrollar esta enfermedad.</strong></p><p><strong>Nuestro último argumento han sido los índices de aborto relacionados con el consumo del tabaco, el 80% de las mujeres que fueron fumadoras constantes durante su embarazo, tuvieron un riesgo de aborto o su hijo nació con alguna deformidad o discapacidad.</strong></p><p></p><p><strong>2</strong></p><p><strong>Es por esta razón que cerramos el texto recomendando a la gente que no fume, ya que como se observa, el fumar produce grandes riesgos para la salud, por lo que las regulaciones de su consumo deberían ser mayores y prohibirse la venta a menores de edad y mujeres embarazadas,</strong></p><p></p><p><strong>3</strong></p><p><strong>En el presente texto hablaremos de una popular costumbre que ha estado en nuestro país durante años, el consumo de tabaco. Si bien el fumar es algo muy común hoy en día, queremos demostrar gracia a las investigaciones que se hicieron este año (1982), que fumar conlleva unos riesgos muy serios, por lo que lo desaconsejamos.</strong></p><p></p>',21,'seleccionMultiple',10,1,1,0,'2022-02-18 07:28:22','2022-02-18 22:55:41');
